// export default Projects;


import React from 'react';

const Projects = () => (
  <div className="container">
    <h2>Projects</h2>
    <ul className="list-group">
      <li className="list-group-item">Easypaisa App on C++ (OOP)</li>
      <li className="list-group-item">Search Engine DSA C++</li>
      <li className="list-group-item">Airline Reservation System Java</li>
      <li className="list-group-item">Vehicle Management System on Java and C# with Database Connectivity</li>
      <li className="list-group-item">Heart Disease Prediction using Logistic Regression Machine Learning with Front-end connectivity</li>
      <li className="list-group-item">Testing Car Rental System using JUnit</li>
      <li className="list-group-item">Deep Learning ResNet50 trained on CIFAR-10 with Front-end connectivity</li>
    </ul>
  </div>
);

export default Projects;
